import React,{useState} from 'react';

import { Route,Routes,Link } from 'react-router-dom';
import './Main_c.css';
import Header from './Header.js';
import Freeapp from './Freeapp';
import Signin from './Signin';


function Main(){
	const[freeapp,setFreeapp]=useState(false);
	return(
	<>

	<header className="head1">
	<h1>NETFLIX</h1>

	<div className="l1" >
	<Link to='/signin'  target="_blank" className="btn btn-primary" >SIGN IN</Link>
	</div>
	<div>
       <Routes>
		      <Route exact path="/signin"><Signin /></Route>
			  <Route  path="/freeapp" ><Freeapp/></Route>
		</Routes>		

	</div>



	<div className="main1">
	<h1>The Netflix app is the best way to watch on your smartphone or tablet.</h1>


	<center><Link to='/freeapp' target="_blank" className="link" >Get the free App</Link></center>		
	</div>

	</header>
	</>
	);
}

export default Main;
